import car1 from '../img/car1.jpg'
import car2 from '../img/car2.jpg'
import car3 from '../img/car3.jpg'
import car4 from '../img/car4.jpg'
import car5 from '../img/car5.jpg'

var data = {
    cardData:[
        {
            id:1,
            img: car1,
            title: 'Elantra',
            price: '5.99$/hour',
            Availability: 'Active'
        },
        {
            id:2,
            img: car2,
            title: 'Urus',
            price: '20.99$/hour',
            Availability: 'Out of Service'
        },
        {
            id:3,
            img: car3,
            title: 'Corvette 2020',
            price: '15.99$/hour',
            Availability: 'Active'
        },
        {
            id:4,
            img: car4,
            title: 'Corvette 2016',
            price: '12.99$/hour',
            Availability:'Out of Service'
        },
        {
            id:5,
            img: car5,
            title: 'Honda',
            price: '8.99$/hour',
            Availability: 'Active'
        },
    ]
}
export default data;
